import React from 'react';
import styled from 'styled-components';

const TileContainer = styled.li`
    width: 250px;
    height: 150px;
    display: block;
    position: relative;
    margin: 5px;
    padding: 10px;
    border-radius: 2px;
    color: #EBEBEB;
    background-color: rgba(255, 255, 255, 0.05);
    /* box-shadow: 
    0px 0px 0px 1px rgba(0, 0, 0, 0.05),
    0px 4px 24px 0px rgba(0, 0, 0, 0.05), 
    0px 4px 8px 0px rgba(0, 0, 0, 0.05); */
    &:hover {
        transition: transform .3s;
        -ms-transform: scale(1.025);
        -webkit-transform: scale(1.025);
        transform: scale(1.025);
    }
`

const TileHeading = styled.h2`
    margin: 0;
    font-size: 18px;
    margin: 10px 10px;
`

const TileSubHeading = styled.p`
    font-weight: 300;
    position: absolute;
    margin: 0;
    bottom: 28px;
    left: 10px;
`

const Tile = () => {
    return (
        <TileContainer>
            <TileHeading>
                Fullham Vs. Arsenal
            </TileHeading>
            <TileSubHeading>
                Football
            </TileSubHeading>
        </TileContainer>
    )
}

export default Tile;
